import React from "react";
import styled from "styled-components";
import { Container } from "../../layout/Container";

const Details = () => {
  return (
    <Container>
      <Context>
        <p>Details</p>
      </Context>
    </Container>
  );
};

const Context = styled.div`
  display: grid;
  background-color: ${({ theme }) => theme.color.lightGrey};
`;

export default Details;
